import React from 'react';
import { Table } from 'react-bootstrap';

const ViewProtectionSchedulePersons = ({ protection_schedule, students_list_for_schedule }) => {
    const formatDate = (date) => {
        const options = { day: 'numeric', month: 'long', year: 'numeric' };
        return date.toLocaleDateString('ru-RU', options);
    };

    const getFullName = (studentData) => {
        if (studentData && studentData.student) {
            const { last_name, first_name, patronymic } = studentData.student;
            return `${last_name} ${first_name} ${patronymic}`;
        } else {
            return 'Unknown';
        }
    };

    const distributeStudentsByProtectionDays = (schedule) => {
        const groupedSchedule = {};
    
        schedule.forEach((item) => {
            if (!item.group) return;
    
            const dateKey = formatDate(item.date);
            const groupName = item.group.name;
            const groupId = item.group.id;
    
            if (!groupedSchedule[dateKey]) {
                groupedSchedule[dateKey] = {};
            }
    
            if (!groupedSchedule[dateKey][groupName]) {
                groupedSchedule[dateKey][groupName] = { day1: [], day2: [] };
            }
    
            const currentGroup = groupedSchedule[dateKey][groupName];
            const students = students_list_for_schedule.filter(student => student.student.group.id === groupId);
    
            // Определяем, к какому дню добавлять студентов
            const dayToAdd = item.date.getDate() === new Date().getDate() ? 'day1' : 'day2';
    
            // Исключаем студентов, которые уже были добавлены на предыдущие дни
            const previousDaysStudents = Object.values(groupedSchedule[dateKey]).flatMap(day => day.day1.concat(day.day2));
            const filteredStudents = students.filter(student => !previousDaysStudents.some(prevStudent => prevStudent.student.id === student.student.id));
    
            // Добавляем студентов в соответствующий день
            currentGroup[dayToAdd].push(...filteredStudents);
        });
    
        // Удаляем повторяющихся студентов между днями
        Object.values(groupedSchedule).forEach((group) => {
            Object.values(group).forEach((days) => {
                const day1Students = days.day1.map(student => student.student.id);
                days.day2 = days.day2.filter(student => !day1Students.includes(student.student.id));
            });
        });
    
        return groupedSchedule;
    };
    
    
    
    
    
    
    
    const groupedSchedule = distributeStudentsByProtectionDays(protection_schedule);

    return (
        <div>
            {Object.entries(groupedSchedule).map(([date, groups]) => (
                <div key={date}>
                    <h3>{date}</h3>
                    {Object.entries(groups).map(([group, days]) => (
                        <React.Fragment key={group}>
                            {days.day1.length > 0 && (
                                <Table bordered hover>
                                    <thead>
                                        <tr>
                                            <th>ФИО</th>
                                            <th>Группа</th>
                                            <th>Дата</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {days.day1.map((student, index) => (
                                            <tr key={index}>
                                                <td>{getFullName(student)}</td>
                                                <td>{group}</td>
                                                <td>{date}</td>
                                            </tr>
                                        ))}
                                    </tbody>
                                </Table>
                            )}
                            {days.day2.length > 0 && (
                                <Table bordered hover>
                                    <thead>
                                        <tr>
                                            <th>ФИО</th>
                                            <th>Группа</th>
                                            <th>Дата</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {days.day2.map((student, index) => (
                                            <tr key={index}>
                                                <td>{getFullName(student)}</td>
                                                <td>{group}</td>
                                                <td>{date}</td>
                                            </tr>
                                        ))}
                                    </tbody>
                                </Table>
                            )}
                        </React.Fragment>
                    ))}
                </div>
            ))}
        </div>
    );
};

export default ViewProtectionSchedulePersons;
